widgets.onCreate:
globals.fadeOutOtherPlayerButtons = function(sex, currentId, value) {
  var channel = (sex == 'male') ? 2 : 3;
  for (let otherId = 1; otherId <= 100; otherId++) {
    if (sex + '_player_presentation_' + currentId != sex + '_player_presentation_' + otherId && get(sex + '_player_presentation_' + otherId, value) != 0) {
      console.log('found active button: ' + otherId + ' - stopping it now!')
      set(sex + '_player_presentation_' + otherId, 0)
    }
  }
}

globals.fadeOut = function(channel, cc, btnId) {

    var fps = 30
    var from = 127
    var to = 0

      var start = Date.now()
      setInterval(function(){
        var pos = (Date.now() - start) / get('player_presentation_fade_time')

        var val  = pos * (to - from) + from
        if (pos >= 1) {
          pos = 1
          clearInterval()
          setVar(btnId, 'text', getProp(btnId, 'comments'))
          setVar(btnId, 'opacity', 1)
          console.log('setting cc value to: ' + to)
          send('midi:watchout', '/control', channel, cc, to)
        } else {
          setVar(btnId, 'opacity', 1-pos)
          console.log('sending cc value: ' + val)
          send('midi:watchout', '/control', channel, cc, val)
        }

      }, 1000 / fps)

}

globals.startTimer = function(duration, sex, id) {

    setVar(sex + '_player_presentation_' + id, 'text', '>>>')
    duration = duration - 1
    var timer = duration, minutes, seconds;
    setInterval(function () {
        minutes = parseInt(timer / 60, 10);
        seconds = parseInt(timer % 60, 10);

        minutes = minutes < 10 ? "0" + minutes : minutes;
        seconds = seconds < 10 ? "0" + seconds : seconds;

        setVar(sex + '_player_presentation_' + id, 'text', '' + minutes + ':' + seconds + '')

        if (--timer < 0 || duration == 0 || get(sex + '_player_presentation_' + id) == 0) {
            clearInterval()
            set(sex + '_player_presentation_' + id, 0)

        }
    }, 1000);
}

globals.playerPresentationToggle = function(sex, id, value) {

  var channel = (sex == 'male') ? 2 : 3;

  if (value == 0) {
    console.log('stopping button ' + id)
    globals.fadeOut(channel, id, sex + '_player_presentation_' + id)
    console.log('fade out finished')
  } else if (value == 127) {
    console.log('starting button ' + id)
    globals.startTimer(25, sex, id) // start timer
    send('midi:watchout', '/control', channel, id, 127)
    globals.fadeOutOtherPlayerButtons(sex, id, value)
  }

}

